// @grant          none
// ==/UserScript==


function wrapper(plugin_info) {

    // Make sure that window.plugin exists. IITC defines it as a no-op function,
    // and other plugins assume the same.
    if (typeof window.plugin !== "function") window.plugin = function () {};

    window.plugin.PortalDetailMods = function () {};
    var self = window.plugin.PortalDetailMods;
    self.id = 'PortalDetailMods';
    self.title = 'PortalDetailMods';
    self.version = '0.4.0.20260124.150000';
    self.author = 'Whomiga';

    // Name of the IITC build for first-party plugins
    plugin_info.buildName = "PortalDetailMods";

    // Datetime-derived version of the plugin
    plugin_info.dateTimeVersion = "20260124.150000";

    // ID/name of the plugin
    plugin_info.pluginId = "portalDetailMods";

    self.namespace = 'window.plugin.' + self.id + '.';
    self.pluginname = 'plugin-' + self.id;

/*
** Colors used by Interface
*/
    const default_Color = '#ffce00';

    let default_Colors = Object.freeze({
        Main:     default_Color,
        Label:    default_Color,
        Border:   '#ffffff',
        Gadget:   '#ffffff',
        BackGrnd: 'rgba(8, 60, 78, 0.9)',
    });

/*
// Interface Information
*/
    self.interfaceData = Object.freeze({
        // Settings Dialog
        settings: {
            title: 'PortalDetailMods',
            id:    'portaldetailmods',
            // Colors Used In Dialog
            colors: {
                Main:     default_Colors.Main,
                Label:    default_Colors.Label,
                Border:   default_Colors.Border,
                Gadget:   default_Colors.Gadget,
                BackGrnd: default_Colors.BackGrnd,
            },
            // Buttons Used In Dialog
            buttons: {
                ok: {
                    text: 'OK',
                    click: dialog_handleOKButton
                }
            },
            // Elements Used In Dialog
            elements: {
                imagemode: {
                    type: 'select',
                    label: 'Image Mode:',
                    options: {
                        original: { text: 'Ingress {REDACTED}', option: 'original' },
                        prime:    { text: 'Ingress Prime',      option: 'prime' },
                        icon:     { text: 'Icon Images',        option: 'icon' }
                    },
                    settings: 'imageMode', default: 'icon',
                    events: {
                        types: ['change'],
                        handler: settings_handleImageMode
                    }
                }
            }
        },
        // Portal Details
        portaldetails: {
            mods: {
                id: 'mods'
            }
        }
   })    

/*
** Default Handler for OK Button
*/
    function dialog_handleOKButton() {
        $(this).dialog('close');
    }

//
// Settings
//
    const KEY_SETTINGS = "plugin-portaldetailmods";
    const SETTINGS_PREFIX = "portaldetailmods-settings--";
    self.settings = {
        imageMode: self.interfaceData.settings.elements.imagemode.default,
    };

//
// Type of OS/Browser
//    
    function isMobile() {
        return (typeof android !== "undefined" && !!android);
    }

    function isiOS() {
        return (/iPad|iPhone|iPod/.test(navigator.userAgent) && !window.MSStream);
    }

    function isFirefox() {
        return (/Firefox/i.test(navigator.userAgent));
    }

//
// Mods Related Functions & Definitions
//
    function mods_getImageByKey(key, imageMode) {
        const prefix = "data:image/webp;base64,";

        // All Images Should Be 64 Pixels Wide With A Minimum Height of 64
        // and a Maximum Height of 70 Pixels
        //
        var item_ModImages = {
            prime: {
            // Multi-Hacks
                "COMMON_MULTI-HACK":    "",
                "RARE_MULTI-HACK":      "",
                "VERY_RARE_MULTI-HACK": "",
            // Heat Sinks
                "COMMON_HEAT_SINK":    "",
                "RARE_HEAT_SINK":      "",
                "VERY_RARE_HEAT_SINK": "",
            // Link Amps
                "RARE_LINK_AMP":      "",
                "VERY_RARE_LINK_AMP": "",
            // Premium Portal Mods
                "VERY_RARE_SOFTBANK_ULTRA_LINK": "",
                "VERY_RARE_ITO_EN_TRANSMUTER_(+)": "",
                "VERY_RARE_ITO_EN_TRANSMUTER_(-)": "",
            // Shields
                "COMMON_PORTAL_SHIELD":    "",
                "RARE_PORTAL_SHIELD":      "",
                "VERY_RARE_PORTAL_SHIELD": "",
                "VERY_RARE_AEGIS_SHIELD":  "",
            // Protection
                "RARE_TURRET": "",
                "RARE_FORCE_AMP": "",
            },
            original: {
            // Multi-Hacks
                "COMMON_MULTI-HACK":    "",
                "RARE_MULTI-HACK":      "",
                "VERY_RARE_MULTI-HACK": "",
            // Heat Sinks
                "COMMON_HEAT_SINK": "",
                "RARE_HEAT_SINK": "",
                "VERY_RARE_HEAT_SINK": "",
            // Link Amps
                "RARE_LINK_AMP": "",
                "VERY_RARE_LINK_AMP": "",
            // Premium Portal Mods
                "VERY_RARE_SOFTBANK_ULTRA_LINK": "",		
                "VERY_RARE_ITO_EN_TRANSMUTER_(+)": "",
                "VERY_RARE_ITO_EN_TRANSMUTER_(-)": "",
            // Shields
                "COMMON_PORTAL_SHIELD": "",
                "RARE_PORTAL_SHIELD": "",
                "VERY_RARE_PORTAL_SHIELD": "",
                "VERY_RARE_AEGIS_SHIELD": "",
                "VERY_RARE_AXA_SHIELD": "",
            // Protection
                "RARE_TURRET": "",
                "RARE_FORCE_AMP": "",
            },
            icon: {
            // Multi-Hacks
                "COMMON_MULTI-HACK":    "",
                "RARE_MULTI-HACK":      "",
                "VERY_RARE_MULTI-HACK": "",
            // Heat Sinks
                "COMMON_HEAT_SINK":     "",
                "RARE_HEAT_SINK":       "",
                "VERY_RARE_HEAT_SINK":  "",
            // Link Amps
                "RARE_LINK_AMP":        "",
                "VERY_RARE_LINK_AMP":   "",
            // Premium Portal Mods
                "VERY_RARE_SOFTBANK_ULTRA_LINK":    "",
                "VERY_RARE_ITO_EN_TRANSMUTER_(+)":  "",
                "VERY_RARE_ITO_EN_TRANSMUTER_(-)":  "",
            // Shields
                "COMMON_PORTAL_SHIELD":     "",
                "RARE_PORTAL_SHIELD":       "",
                "VERY_RARE_PORTAL_SHIELD":  "",
                "VERY_RARE_AEGIS_SHIELD":   "",
            // Protection
                "RARE_TURRET":      "",
                "RARE_FORCE_AMP":   "",
            }
        };
        result = prefix + (item_ModImages[imageMode][key] || BROKEN_IMAGE);
        return result;
    }

// 
// Settings Dialog
//
    function settings_ShowDialog() {
        let interfaceData = self.interfaceData.settings;
        let dialog_id = interfaceData.id;
        let dialog = dialog_GetDialog(dialog_id);
        if (dialog && dialog.dialog('isOpen')) {
            dialog.dialog('close');
            return;
        }
        let container = document.createElement('div');
        container.id = interfaceData.id;

//
//  Settings
//
        settings_CreateElements(container, interfaceData.elements);

//
// Author
//
        let author = container.appendChild(document.createElement('div'));
        author.className = self.id + 'author';
        author.innerHTML = self.title + ' version ' + self.version + ' by ' + self.author;

// Create and open the dialog
        dialog = window.dialog({
			html: container,
            title: interfaceData.title,
            id: dialog_id,
            dialogClass: 'ui-dialog-' + interfaceData.id,
            position: {
                my: 'auto',
                at: 'auto',
                of: window
            },
            width: '400px',
            height: 'auto',
      	    closeCallback: function () {
                dialog_RemoveDialog(dialog_id);
	        }
        }).dialog('option', 'buttons', { ...interfaceData.buttons});
        dialog_AddDialog(dialog_id, dialog);
    }

/*
** Create Elements for Settings
*/    
    function settings_CreateElements(container, elements) {
        Object.entries(elements).forEach(([id, element]) => {
            switch(element.type) {
                case 'select': 
                    var table = container.appendChild(document.createElement('table'));
                    table.className = self.interfaceData.settings.id + '-settings';
                    var row = table.appendChild(document.createElement('tr'));
                    var data = row.appendChild(document.createElement('td'));
                    var label = data.appendChild(document.createElement('label'));
                    label.htmlFor = SETTINGS_PREFIX + id;
                    label.innerHTML = element.label;
                    data = row.appendChild(document.createElement('td'));
                    var select = data.appendChild(document.createElement('select'));
                    select.id = SETTINGS_PREFIX + id;
                    Object.values(element.options).forEach((value) => {
                        var option = select.appendChild(document.createElement('option'));
                        option.textContent = value.text;
                        option.value = value.option;
                    })
                    select.value = self.settings[element.settings];
                    if (element.events) {
                        element.events.types.forEach(eventType => {
                            select.addEventListener(eventType, function(event) {
                                self.settings[element.settings] = this.value;
                                if (element.events.handler) {
                                    element.events.handler(event);
                                }
        		    	        localStorage_Save();
                            });
                        });
                    }
                    break;
            }
        });
    }

/*
** Settings - Event Handlers
*/
    function settings_handleImageMode(event) {
        mods_PortalDetails();
    }

//
//  List of Open Dialog Windows
//
    let dialog_OpenDialogs = [];
    function dialog_AddDialog(id, dialog) {
        dialog_OpenDialogs.push( {
            id: id,
            dialog: dialog
        });
    }

    function dialog_GetDialog(id) {
        let dialog = null;
        let index = dialog_OpenDialogs.findIndex(item => item.id === id);
        if (index > -1)
            dialog = dialog_OpenDialogs[index].dialog;
        return dialog;
    }

    function dialog_RemoveDialog(id) {
        let index = dialog_OpenDialogs.findIndex(item => item.id === id);
        if (index > -1)
            dialog_OpenDialogs.splice(index,1);
    }

//
//  Place Mods Graphics in Portal Details box
//        
    function update_PortalDetails(p) {
        mods_PortalDetails();
	}

    // Update/Change Mods on Portal Details
    function mods_PortalDetails() {
        mods = document.querySelectorAll('.mods span');
        if (mods) {
            Array.from(mods).map(el => {
                el.title = el.title.replace(/rare/g, "Rare");
                el.className = 'randdetails-' + self.interfaceData.portaldetails.mods.id;
                if (el.dataset.key == undefined) {
                    key = el.textContent.toUpperCase().replace(/ /g, '_');
                }
                else {
                    key = el.dataset.key;
                }
                if (key != '') {
                    el.dataset.key = key;
                    let itemimage = document.createElement('img');
                    var image = mods_getImageByKey(key,self.settings.imageMode);
                    itemimage.src = image;
                    el.innerHTML = '';
                    el.appendChild(itemimage);
                }
            });
        }
    }

//
// LocalStorage Related Functions
//    
    function localStorage_Init() {
        if (!localStorage[KEY_SETTINGS]) {
            localStorage[KEY_SETTINGS] = JSON.stringify({
		        settings: [],
            });
        }
    }

    function load_Settings() {
        let localData = localStorage[KEY_SETTINGS];
        if (!localData || localData == "") return;
        localData = JSON.parse(localData);
        if (!(localData instanceof Object)) return;
        if ('settings' in localData && localData.settings instanceof Object) {
            for (const key in self.settings) {
                if (key in localData.settings && typeof self.settings[key] == typeof localData.settings[key]) {
                    self.settings[key] = localData.settings[key];
                }
            }
        }
    };

//
// Save Related Functions
//
    function localStorage_Save() {
		const ls = {};
		self.settings = self.settings; // Why?
		try {
			const localData = JSON.parse(localStorage[KEY_SETTINGS]);
		} catch (e) {}
		ls.settings = self.settings;
		localStorage[KEY_SETTINGS] = JSON.stringify(ls);
	}

//
// Main Setup Function
//
	self.setup = function() {
        if ('pluginloaded' in self) {
            console.log('IITC plugin already loaded: ' + self.title + ' version ' + self.version);
            return;
        } 
        else {
            self.pluginloaded = true;
        }

        localStorage_Init();
        load_Settings();

       	$('<a href="#" title="Shows Mod Pictures on Portal Detail">')
       		.text('PortalDetailMods')
       		.click(settings_ShowDialog)
       		.appendTo($('#toolbox'));
        $("<style>")
            .prop("type", "text/css")
            .html(`

//
// Styles
// 
div#dialog-${self.interfaceData.settings.id} {
    overflow-x: hidden !important;
}

.ui-dialog.ui-dialog-${self.interfaceData.settings.id} {
    max-width: calc(100vw - 2px);
}

.ui-dialog.ui-dialog-${self.interfaceData.settings.id} select {
    background-color: ${default_Colors.Gadget};
}

/* Style the settings */
.${self.interfaceData.settings.id}-settings {
    padding: 8px 8px;
    border: 1px solid ${self.interfaceData.settings.colors.Border};
    background-color: ${self.interfaceData.settings.colors.BackGrnd};
    color: ${self.interfaceData.settings.colors.Main};
    display: flex;
    flex-direction: column;
    flex: 1;
}
  
.${self.interfaceData.settings.id}-settings label {
    border: none;
    margin-left: 0px;
    margin-right: 8px;
    background-color: ${self.interfaceData.settings.colors.BackGrnd};
    color: ${self.interfaceData.settings.colors.Label};
}

.randdetails-${self.interfaceData.portaldetails.mods.id} {
    display: inline-block !important;
    cursor: default !important;
}

.randdetails-${self.interfaceData.portaldetails.mods.id} img {
    width: auto;
    height: 64px;
}
  `).appendTo("head");

//
// Setup Function - Continued
//
        var sheet = document.createElement('style')
        sheet.innerHTML = '.' + self.id + 'author { margin-top: 14px; font-style: italic; font-size: smaller; }';
        document.body.appendChild(sheet);
        window.addHook('portalDetailsUpdated', update_PortalDetails);

        console.log('IITC plugin loaded: ' + self.title + ' version ' + self.version + " ");
    };

    var setup = function() {
        (window.iitcLoaded?self.setup():window.addHook('iitcLoaded',self.setup));
    };

    setup.info = plugin_info; //add the script info data to the function as a property
    if(!window.bootPlugins) window.bootPlugins = [];
    window.bootPlugins.push(setup);
    // if IITC has already booted, immediately run the 'setup' function
    if(window.iitcLoaded && typeof setup === 'function') setup();
} // wrapper end

// inject code into site context
var script = document.createElement('script');
var info = {};
if (typeof GM_info !== 'undefined' && GM_info && GM_info.script) info.script = { version: GM_info.script.version, name: GM_info.script.name, description: GM_info.script.description };
script.appendChild(document.createTextNode('('+ wrapper +')('+JSON.stringify(info)+');'));
(document.body || document.head || document.documentElement).appendChild(script);
